import React, {Fragment} from 'react';
import './styles.css';

function BoardLayout({renderSquare}){
    return (
        <Fragment>
          <div className="board-row">
            {renderSquare(0)}
            {renderSquare(1)}
            {renderSquare(2)}
          </div>
          <div className="board-row">
            {renderSquare(3)}
            {renderSquare(4)}
            {renderSquare(5)}
          </div>
          <div className="board-row">
            {renderSquare(6)}
            {renderSquare(7)}
            {renderSquare(8)}
          </div>
        </Fragment>
    );
}

export default BoardLayout;
